import React from 'react'
import './Sidebar.css'
import FavoritesLink from 'FavoritesLink.js'

export default class FavoritesDiv extends React.Component {
    render() {
        
        return (
        <div id="favoritesDiv">
        {this.props.articles.map(function(article){
            return <FavoritesLink article={article}/>;
        })}</div>
        );
    }
}
